post_text:
CISD Parent Update: We have been contacted regarding a post from March 31st that read as follows;

"For those that are needing a" low tech" option for their child, work packets are available at every campus in their foyer area."
Some parents have taken this as "extra" work for their child. The post was not for extra work, but was only intended for those parents who had to have a "low tech" option due to not having access to internet.

